--fips_country_code
CREATE TABLE fips_country_code
(
  code      	VARCHAR(20) PRIMARY KEY,
  description  	VARCHAR(200)
);
COMMIT;


--fips_state_code
CREATE TABLE fips_state_code
(
  code           VARCHAR(2) PRIMARY KEY,
  usps_code           VARCHAR(2),
  name              VARCHAR(200)
);
COMMIT;


--fips_county_CODE
CREATE TABLE fips_county
(
  code       VARCHAR(3),
  state_code           VARCHAR(2) REFERENCES fips_state_code(code),
  name          VARCHAR(43),
  PRIMARY KEY (code, state_code)
);
COMMIT;



