INSERT INTO facility_category_code (code,name,description) VALUES ('HAP','HAP Major','Facility is Major based upon only 40 CFR 70 Major Source definition paragraph 1 (10/25 tpy HAPs).');
INSERT INTO facility_category_code (code,name,description) VALUES ('CAP','CAP Major','Facility is Major based upon 40 CFR 70 Major Source definition paragraph 2 (100 tpy any CAP.  Also meets paragraph 3 definition, but NOT paragraph 1 definition).');
INSERT INTO facility_category_code (code,name,description) VALUES ('OZN','O3 n/a Major','Facility is Major based upon only 40 CFR 70 Major Source definition paragraph 3 (Ozone n/a area lesser tons for NOx or VOC).');
INSERT INTO facility_category_code (code,name,description) VALUES ('HAPCAP','HAP and CAP Major','Facility meets both paragraph 1 and 2 of 40 CFR 70 Major Source definitions (10/25 tpy HAPs and 100 tpy any CAP).');
INSERT INTO facility_category_code (code,name,description) VALUES ('HAPOZN','HAP and O3 n/a Major','Facility meets both paragraph 1 and 3 of 40 CFR 70 Major Source definitions (10/25 tpy HAPs and Ozone n/a area lesser tons for NOx or VOC).');
INSERT INTO facility_category_code (code,name,description) VALUES ('SYN','Synthetic non-Major','Facility has a FESOP which limits its Potential To Emit below all three 40 CFR 70 Major Source definitions.');
INSERT INTO facility_category_code (code,name,description) VALUES ('NON','Non-Major','Facility''s Potential To Emit is below all 40 CFR 70 Major Source threshold definitions without a FESOP.');
INSERT INTO facility_category_code (code,name,description) VALUES ('UNK','Unknown','Facility category per 40 CFR 70 Major Source definitions is unknown.');
